import React, { useRef, useState } from 'react';
import emailjs from '@emailjs/browser';
import InnerBanner from '../components/InnerBanner/InnerBanner'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
import { Alert } from 'react-bootstrap';

function Contact() {
    const form = useRef();
    const [success, setSuccess] = useState('')
    const [loading, setLoading] = useState(false)
    const [formData, setFormData] = useState({
        name: '',
        email: '',
        phone: '',
        message: ''
    });

    const [errors, setErrors] = useState({
        name: '',
        email: '',
        phone: '',
        message: ''
    });
    const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
    };
    const isValidEmail = (email) => {
        // Simple email validation using regex
        const emailRegex = /^[^\s@]+@[^\s@]+\.[^\s@]+$/;
        return emailRegex.test(email);
    };
    const sendEmail = (e) => {
        e.preventDefault();
         // Validation
         if (formData.name === '') {
            setErrors({name:'Please enter your name'})
            return;
        }
        if (formData.email === '') {
            setErrors({email:'Please enter your email'})
            return;
        }
        if (!isValidEmail(formData.email)) {
            setErrors({email:'Please enter a valid email'})
            return;
        }
        if (formData.phone === '') {
            setErrors({phone:'Please enter your phone number'})
            return;
        }
        if (formData.message === '') {
            setErrors({message:'Please enter your comments'})
            return;
        }
        setLoading

        emailjs
            .sendForm('service_ecwlxqg', 'template_w8r6f35', form.current, {
                publicKey: '3XLW0uvmLxar8lvNn',
            })
            .then(
                () => {
                    setSuccess('Thank you for getting in touch!')
                    e.target.reset();
                },
                (error) => {
                    toast.error("Please check your form", { position: "bottom-right" });
                },
            );

    };
    return (
        <div className='innerpage wuudply__contact'>

            <InnerBanner image={'assets/img/contact.jpg'} title='Contact' />
            <section className='pb-0'>
                <div className="container">
                    <h2 data-aos="fade-up" data-aos-duration="1000">Want to know more? </h2>
                    <div className="row justify-content-between">
                        <div className="col-md-5 col-tab-6">
                            <h4 data-aos="fade-up" data-aos-duration="1500">We’re always happy to hear from customers, partners, and distributors.</h4>
                        </div>
                        <div className="col-md-6">
                            <form ref={form} onSubmit={sendEmail} data-aos="fade-up" data-aos-duration="3000">
                                <div className="form-group">
                                    <label htmlFor="name">Name</label>
                                    <input type="text" className="form-control" name='name' onChange={handleChange} />
                                    { errors.name && <span>{errors.name}</span> }

                                </div>
                                <div className="form-group">
                                    <label htmlFor="Email">Email</label>
                                    <input type="text" className="form-control" name='email' onChange={handleChange}  />
                                    { errors.email && <span>{errors.email}</span> }
                                </div>
                                <div className="form-group">
                                    <label htmlFor="Phone">Phone</label>
                                    <input type="text" className="form-control" name='phone' onChange={handleChange} />
                                    { errors.phone && <span>{errors.phone}</span> }
                                </div>
                                <div className="form-group">
                                    <label htmlFor="Message">Message</label>
                                    <textarea className="form-control" cols="30" rows="6" name='message' onChange={handleChange}></textarea>
                                    { errors.message && <span>{errors.message}</span> }
                                </div>
                                {
                                    success && <Alert key={'success'} variant={'success'} className='mb-3'>{success}</Alert>
                                }
                                <button type="submit" className="btn btn-primary">Submit</button>


                            </form>
                        </div>
                    </div>
                </div>

                <div className="whatsapp">
                    <div className="container">
                        <h3><a data-aos="fade-up" data-aos-duration="1500" href="https://wa.me/+919895112233" target='_blank'><span>Whatsapp :</span> +91 9895 112 233</a> <br /> <a target='_blank' data-aos="fade-up" data-aos-duration="2000" href="mailto:Info@wuudply.in"><span>Email :</span > Info@wuudply.in</a></h3>
                    </div>
                </div>
            </section>
        </div>
    )
}

export default Contact
